func specialTriplets(nums []int) int {
	// special triplet - (i, j, k):
	// 0 <= i < j < k < n, n = len(nums)
	// nums[i] == nums[j] * 2
	// nums[j] == nums[k] * 2
	result := 0
	var second, third []int
	mapNums := make(map[int][]int)

	//       
	//      
	//        
	for i, num := range nums {
		mapNums[num] = append(mapNums[num], i)
	}

	lastVisited := make(map[int]int)
	smallJ := 0

	//    nums  i, num
	//    (second)   num*2.
	//    j  second   i < j.
	//  ,   
	//        k.
	//    ,  result++
	for i, num := range nums {
		if num%2 != 0 {
			continue
		}
		second = mapNums[num/2]
		smallJ = 0
		for jIndex, j := range second[lastVisited[num/2]:] {
			//if num == 35246 {
			//	fmt.Println("II", lastVisited[35246/2])
			//}
			//lastVisited[num/2] += jIndex
			if i < j {
				third = mapNums[num]
				for kIndx, k := range third {
					if j < k {
						//  :  k  third      
						result += len(third[kIndx:])
						//fmt.Println(i, num, j, num/2, k, kIndx, third)
						break
					}
				}
			} else {
				smallJ = jIndex
			}
		}
		lastVisited[num/2] += smallJ
	}
	// 5 .      ,   .

	return result % (1000000000 + 7)
}
